script: |
  super -f text -I q13265.spq | sort > q13265.out

inputs:
  - name: q13265.spq
    data: |
      SELECT ALL col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 60 * col0 / - col2 + - col1 + + 81 BETWEEN + col2 AND ( + - 11 );
  - name: tab1

outputs:
  - name: q13265.out
    data: |
      14
      47
      5
